"use strict";(self.webpackChunkspanish_prototype=self.webpackChunkspanish_prototype||[]).push([[4386],{4386:e=>{e.exports=JSON.parse('{"lessonId":"B1_U85","title":"\u0423\u0440\u043e\u043a 85: \u0412\u044b\u0440\u0430\u0436\u0435\u043d\u0438\u0435 \u0432\u0435\u0440\u043e\u044f\u0442\u043d\u043e\u0441\u0442\u0438","level":"B1","components":[{"type":"TheoryBlock","title":"\u0422\u0435\u043e\u0440\u0438\u044f: \u0412\u044b\u0440\u0430\u0436\u0435\u043d\u0438\u0435 \u0432\u0435\u0440\u043e\u044f\u0442\u043d\u043e\u0441\u0442\u0438 + Subjuntivo","content":[{"text":"<strong>\u041d\u0435\u043a\u043e\u0442\u043e\u0440\u044b\u0435 \u0432\u044b\u0440\u0430\u0436\u0435\u043d\u0438\u044f \u0443\u043a\u0430\u0437\u044b\u0432\u0430\u044e\u0442 \u043d\u0430 \u0440\u0430\u0437\u043d\u0443\u044e \u0441\u0442\u0435\u043f\u0435\u043d\u044c \u0432\u0435\u0440\u043e\u044f\u0442\u043d\u043e\u0441\u0442\u0438 + \u0441\u043e\u0441\u043b\u0430\u0433\u0430\u0442\u0435\u043b\u044c\u043d\u043e\u0435 \u043d\u0430\u043a\u043b\u043e\u043d\u0435\u043d\u0438\u0435.</strong>"},{"list":["<strong>es posible/imposible que</strong><br><strong>es probable/improbable que</strong><br><strong>posiblemente</strong><br><strong>probablemente</strong><br><strong>puede que</strong><br><strong>quiz\xe1s, quiz\xe1</strong><br><strong>tal vez</strong>","<i>Es imposible que <strong>ganemos</strong>. Jugamos muy mal.<br>Era poco probable que <strong>encontrara</strong> trabajo.<br>Posiblemente <strong>llueva</strong>. Hay muchas nubes.<br>Probablemente <strong>cambie</strong> hoy el tiempo.</i>"]},{"text":"<strong>- \u0438\u0441\u043f\u043e\u043b\u044c\u0437\u0443\u0435\u0442\u0441\u044f presente de subjuntivo, \u043a\u043e\u0433\u0434\u0430 \u0440\u0435\u0447\u044c \u043e \u043d\u0430\u0441\u0442\u043e\u044f\u0449\u0435\u043c \u0438\u043b\u0438 \u0431\u0443\u0434\u0443\u0449\u0435\u043c.</strong><br><i>\u2013Sabe d\xf3nde est\xe1 el Sr. Pav\xf3n? No est\xe1 en su oficina. No s\xe9. Quiz\xe1 <strong>est\xe9</strong> en la cafeter\xeda.</i>"},{"text":"<strong>- \u0438\u0441\u043f\u043e\u043b\u044c\u0437\u0443\u0435\u0442\u0441\u044f imperfecto de subjuntivo, \u043a\u043e\u0433\u0434\u0430 \u0440\u0435\u0447\u044c \u043e \u043f\u0440\u043e\u0448\u043b\u043e\u043c.</strong><br><i>Era poco probable que <strong>aprobara</strong>. Hab\xeda estudiado muy poco.<br>\u2013\xbfSabes si Pedro ha hablado con Ricardo? \u2013Puede que lo <strong>hiciera</strong> anoche. Regres\xf3 tarde.</i>"},{"text":"<strong>\u041d\u041e:</strong> \u0421 `quiz\xe1s, quiz\xe1, tal vez` \u043c\u043e\u0436\u043d\u043e \u0438\u0441\u043f\u043e\u043b\u044c\u0437\u043e\u0432\u0430\u0442\u044c `pret\xe9rito indefinido` \u0438 \u0434\u0440\u0443\u0433\u0438\u0435 \u0432\u0440\u0435\u043c\u0435\u043d\u0430.<br><i>\u2013Est\xe1n cansados. \u2013Quiz\xe1 se <strong>acostaron</strong> tarde anoche.</i>"},{"text":"<strong>- \u0438\u0441\u043f\u043e\u043b\u044c\u0437\u0443\u0435\u0442\u0441\u044f `es posible/imposible + infinitivo`, \u043a\u043e\u0433\u0434\u0430 \u0440\u0435\u0447\u044c \u043e\u0431 \u043e\u0431\u0449\u0435\u0439 \u0441\u0438\u0442\u0443\u0430\u0446\u0438\u0438.</strong><br><i>Es imposible <strong>dormir</strong> en esta casa. Hay demasiado ruido.</i>"}]},{"type":"TheoryBlock","title":"\u0422\u0435\u043e\u0440\u0438\u044f: \u0412\u044b\u0440\u0430\u0436\u0435\u043d\u0438\u0435 \u0432\u0435\u0440\u043e\u044f\u0442\u043d\u043e\u0441\u0442\u0438 + Indicativo","content":[{"text":"<strong>`Seguramente` + presente/futuro de indicativo \u0438\u043b\u0438 presente de subjuntivo.</strong><br><i>\u2013\xbfSabes d\xf3nde est\xe1 Mart\xedn? \u2013<strong>Seguramente est\xe1/est\xe9</strong> en casa. No sale mucho.</i><br><i>\u2013\xbfCu\xe1ndo vas a enviarle un correo electr\xf3nico a Clara? \u2013<strong>Seguramente lo har\xe9</strong> esta noche.</i>"},{"text":"<strong>`Seguramente` + \u0434\u0440\u0443\u0433\u0438\u0435 \u0432\u0440\u0435\u043c\u0435\u043d\u0430 indicativo.</strong><br><i>Santi no contesta el tel\xe9fono. <strong>Seguramente ha salido</strong>.<br>Martina tiene un poncho precioso. \u2013<strong>Seguramente lo compr\xf3</strong> cuando estuvo en Per\xfa.</i>"}]},{"type":"FillInTheBlank","title":"\u0423\u043f\u0440\u0430\u0436\u043d\u0435\u043d\u0438\u0435 85.1: \u0414\u043e\u043f\u043e\u043b\u043d\u0438\u0442\u0435 \u0444\u0440\u0430\u0437\u044b \u0441 Presente de subjuntivo","tasks":[{"id":"u85_1_1","sentence":"1. \u2013\xbfCree que va a llover esta tarde? \u2013No s\xe9. Puede que ___.","answer":"llueva"},{"id":"u85_1_2","sentence":"2. \u2013\xbfVais a ir a la fiesta de Elisa? \u2013Tenemos mucho que estudiar. Quiz\xe1s ___.","answer":"no vayamos"},{"id":"u85_1_3","sentence":"3. \u2013\xbfEst\xe1 Carmen Per\xf3n en su despacho? \u2013No s\xe9. Es posible que ___ Mira t\xfa.","answer":"est\xe9"},{"id":"u85_1_4","sentence":"4. \u2013\xbfSabes si Alicia va a venir hoy a clase? \u2013No s\xe9. Puede que ___ \xdaltimamente no viene mucho.","answer":"no venga"},{"id":"u85_1_5","sentence":"5. \u2013\xbfPor qu\xe9 no duermes bien? \u2013Es imposible ___ aqu\xed. Hay mucho ruido.","answer":"dormir"},{"id":"u85_1_6","sentence":"6. \u2013\xbfSabes si hay un tren a Aguascalientes? \u2013Posiblemente ___ uno por la ma\xf1ana.","answer":"salga"},{"id":"u85_1_7","sentence":"7. \u2013\xbfSabe si Celia quiere trabajar este verano? \u2013No s\xe9, pero es probable que ___.","answer":"quiera"},{"id":"u85_1_8","sentence":"8. \u2013\xbfNo puede encontrar otro piso mejor? \u2013Es imposible ___ nada mejor por este precio.","answer":"encontrar"}]},{"type":"FillInTheBlank","title":"\u0423\u043f\u0440\u0430\u0436\u043d\u0435\u043d\u0438\u0435 85.2: \u0414\u043e\u043f\u043e\u043b\u043d\u0438\u0442\u0435 \u0434\u0438\u0430\u043b\u043e\u0433\u0438 \u0441 Imperfecto de subjuntivo \u0438\u043b\u0438 Pret\xe9rito indefinido","tasks":[{"id":"u85_2_1","sentence":"1. \u2013Miguel dijo la verdad. \u2013No te creo. Es imposible que ___ la verdad.","answer":"dijera"},{"id":"u85_2_2","sentence":"2. \u2013Fue Jos\xe9. \u2013Seguro. \u2013Yo no estoy tan segura. Puede que ___.","answer":"fuera"},{"id":"u85_2_3","sentence":"3. \u2013Lo hizo Sara. \u2013\xbfEst\xe1s seguro? Quiz\xe1s ___.","answer":"lo hizo"},{"id":"u85_2_4","sentence":"4. \u2013Aurora no vino la semana pasada porque estaba enferma. \u2013S\xed. Es probable que ___.","answer":"estuviera"},{"id":"u85_2_5","sentence":"5. \u2013Mario dice que se olvid\xf3. \u2013Tal vez ___ Es muy despistado.","answer":"se olvid\xf3"}]},{"type":"FillInTheBlank","title":"\u0423\u043f\u0440\u0430\u0436\u043d\u0435\u043d\u0438\u0435 85.3: \u0414\u043e\u043f\u043e\u043b\u043d\u0438\u0442\u0435 \u043e\u0442\u0432\u0435\u0442\u044b","tasks":[{"id":"u85_3_1","sentence":"1. \u2013\xbfVas a ver pronto a Tom\xe1s? \u2013S\xed. Seguramente lo ___ el s\xe1bado.","answer":"ver\xe9"},{"id":"u85_3_2","sentence":"2. \u2013\xbfCrees que vas a aprobar? \u2013S\xed. Seguramente ___.","answer":"aprobar\xe9"},{"id":"u85_3_3","sentence":"3. \u2013\xbfVan a ir a Bariloche este invierno? \u2013S\xed. Seguramente ___ unos d\xedas.","answer":"iremos"},{"id":"u85_3_4","sentence":"4. \u2013\xbfCrees que encontrar\xe9 la cartera? \u2013S\xed. Seguramente la ___ en alg\xfan rinc\xf3n.","answer":"encontrar\xe1s"},{"id":"u85_3_5","sentence":"5. \u2013\xbfSabes si Antonio tiene el tel\xe9fono de Amelia? \u2013S\xed. Seguramente lo ___.","answer":"tendr\xe1"},{"id":"u85_3_6","sentence":"6. \u2013\xbfCrees que ese cuadro lo ha pintado Margarita? \u2013S\xed. Seguramente lo ___ ella.","answer":"habr\xe1 pintado"}]},{"type":"FillInTheBlank","title":"\u0423\u043f\u0440\u0430\u0436\u043d\u0435\u043d\u0438\u0435 85.4: \u041d\u0430\u043f\u0438\u0448\u0438\u0442\u0435 \u0444\u0440\u0430\u0437\u044b, \u043e\u043f\u0438\u0441\u044b\u0432\u0430\u044e\u0449\u0438\u0435 \u043a\u0430\u0436\u0434\u0443\u044e \u0441\u0438\u0442\u0443\u0430\u0446\u0438\u044e","tasks":[{"id":"u85_4_1","sentence":"1. \u2013Tel\xe9fono, Lola! \u2013Lo cojo yo. Puede que (ser) ___ V\xedctor.","answer":"sea"},{"id":"u85_4_2","sentence":"2. \u2013\xbfCu\xe1ndo vais a inaugurar el nuevo piso? \u2013Quiz\xe1 lo (hacer) ___ el mes que viene.","answer":"hagamos"},{"id":"u85_4_3","sentence":"3. \u2013Felipe me llama todos los d\xedas. \u2013Seguramente le (gustar) ___.","answer":"gustas"},{"id":"u85_4_4","sentence":"4. Es imposible (encontrar) ___ habitaci\xf3n en ning\xfan hotel. Est\xe1n todos llenos.","answer":"encontrar"},{"id":"u85_4_5","sentence":"5. \u2013Luis no nos salud\xf3 anoche. \u2013Probablemente no os (ver) ___.","answer":"vio"},{"id":"u85_4_6","sentence":"6. \u2013Me apetece comer algo. \u2013Es imposible que (tener) ___ hambre. Hemos comido hace una hora.","answer":"tengas"},{"id":"u85_4_7","sentence":"7. Anoche no dorm\xed bien. Puede que me (sentar) ___ algo mal.","answer":"sentara"}]}]}')}}]);